import * as React from "react";
import { Box } from "@chakra-ui/core";
import { AngleSection } from "./AngleSection";
import { Logo } from "./Logo";

export const Hero = props => {
  return (
    <AngleSection height="90vh" color="blue.300" mt={0} {...props}>
      <Box>
        <Logo.Typographic />
      </Box>
    </AngleSection>
  );
};
